        output_dim = self.cell.state_size

    if self.return_sequences:
        output_shape = (input_shape[0], input_shape[1], output_dim)
    else:
        output_shape = (input_shape[0], output_dim)

    if self.return_state:
        state_shape = [(input_shape[0], output_dim) for _ in self.states]
        return [output_shape] + state_shape
    else:
        return output_shape

def compute_mask(self, inputs, mask):
    if isinstance(mask, list):
        mask = mask[0]
    output_mask = mask if self.return_sequences else None
    if self.return_state:
        state_mask = [None for _ in self.states]
        return [output_mask] + state_mask
    else:
        return output_mask

def build(self, input_shape):
    # Note input_shape will be list of shapes of initial states and
    # constants if these are passed in __call__.
    if self._num_constants is not None:
        constants_shape = input_shape[-self._num_constants:]
    else:
        constants_shape = None

    if isinstance(input_shape, list):
        input_shape = input_shape[0]

    batch_size = input_shape[0] if self.stateful else None
    input_dim = input_shape[-1]
    self.input_spec[0] = InputSpec(shape=(batch_size, None, input_dim))

    # allow cell (if layer) to build before we set or validate state_spec
    if isinstance(self.cell, Layer):
        step_input_shape = (input_shape[0],) + input_shape[2:]
        if constants_shape is not None:
            self.cell.build([step_input_shape] + constants_shape)
        else:
            self.cell.build(step_input_shape)

    # set or validate state_spec
    if hasattr(self.cell.state_size, '__len__'):
        state_size = list(self.cell.state_size)
    else:
        state_size = [self.cell.state_size]

    if self.state_spec is not None:
        # initial_state was passed in call, check compatibility
        if not [spec.shape[-1] for spec in self.state_spec] == state_size:
            raise ValueError(
                'An initial_state was passed that is not compatible with '
                '`cell.state_size`. Received `state_spec`={}; '
                'However `cell.state_size` is '
                '{}'.format(self.state_spec, self.cell.state_size))
    else:
        self.state_spec = [InputSpec(shape=(None, dim))
                           for dim in state_size]
    if self.stateful:
        self.reset_states()

def get_initial_state(self, inputs):
    # build an all-zero tensor of shape (samples, output_dim)
    initial_state = K.zeros_like(inputs)  # (samples, timesteps, input_dim)
    initial_state = K.sum(initial_state, axis=(1, 2))  # (samples,)
    initial_state = K.expand_dims(initial_state)  # (samples, 1)
    if hasattr(self.cell.state_size, '__len__'):
        return [K.tile(initial_state, [1, dim])
                for dim in self.cell.state_size]
    else:
        return [K.tile(initial_state, [1, self.cell.state_size])]

def call(self,
         inputs,
         mask=None,
         training=None,
         initial_state=None,
         constants=None):
    # input shape: `(samples, time (padded with zeros), input_dim)`
    # note that the .build() method of subclasses MUST define
    # self.input_spec and self.state_spec with complete input shapes.
    if isinstance(inputs, list):
        inputs = inputs[0]
    if initial_state is not None:
        pass
    elif self.stateful:
        initial_state = self.states
    else:
        initial_state = self.get_initial_state(inputs)

    if isinstance(mask, list):
        mask = mask[0]

    if len(initial_state) != len(self.states):
        raise ValueError('Layer has ' + str(len(self.states)) +
                         ' states but was passed ' +
                         str(len(initial_state)) +
                         ' initial states.')
    input_shape = K.int_shape(inputs)
    timesteps = input_shape[1]
    if self.unroll and timesteps in [None, 1]:
        raise ValueError('Cannot unroll a RNN if the '
                         'time dimension is undefined or equal to 1. \n'
                         '- If using a Sequential model, '
                         'specify the time dimension by passing '
                         'an `input_shape` or `batch_input_shape` '
                         'argument to your first layer. If your '
                         'first layer is an Embedding, you can '
                         'also use the `input_length` argument.\n'
                         '- If using the functional API, specify '
                         'the time dimension by passing a `shape` '
                         'or `batch_shape` argument to your Input layer.')

    kwargs = {}
    if has_arg(self.cell.call, 'training'):
        kwargs['training'] = training

    if constants:
        if not has_arg(self.cell.call, 'constants'):
            raise ValueError('RNN cell does not support constants')

        def step(inputs, states):
            constants = states[-self._num_constants:]
            states = states[:-self._num_constants]
            return self.cell.call(inputs, states, constants=constants,
                                  **kwargs)
    else:
        def step(inputs, states):
            return self.cell.call(inputs, states, **kwargs)

    last_output, outputs, states = K.rnn(step,
                                         inputs,
                                         initial_state,
                                         constants=constants,
                                         go_backwards=self.go_backwards,
                                         mask=mask,
                                         unroll=self.unroll,
                                         input_length=timesteps)
    if self.stateful:
        updates = []
        for i in range(len(states)):
            updates.append((self.states[i], states[i]))
        self.add_update(updates, inputs)

    if self.return_sequences:
        output = outputs
    else:
        output = last_output

    # Properly set learning phase
    if getattr(last_output, '_uses_learning_phase', False):
        output._uses_learning_phase = True

    if self.return_state:
        if not isinstance(states, (list, tuple)):
            states = [states]
        else:
            states = list(states)
        return [output] + states
    else:
        return output

def reset_states(self, states=None):
    if not self.stateful:
        raise AttributeError('Layer must be stateful.')
    batch_size = self.input_spec[0].shape[0]
    if not batch_size:
        raise ValueError('If a RNN is stateful, it needs to know '
                         'its batch size. Specify the batch size '
                         'of your input tensors: \n'
                         '- If using a Sequential model, '
                         'specify the batch size by passing '
                         'a `batch_input_shape` '
                         'argument to your first layer.\n'
                         '- If using the functional API, specify '
                         'the time dimension by passing a '
                         '`batch_shape` argument to your Input layer.')
    # initialize state if None
    if self.states[0] is None:
        if hasattr(self.cell.state_size, '__len__'):
            self.states = [K.zeros((batch_size, dim))
                           for dim in self.cell.state_size]
        else:
            self.states = [K.zeros((batch_size, self.cell.state_size))]
    elif states is None:
        if hasattr(self.cell.state_size, '__len__'):
            for state, dim in zip(self.states, self.cell.state_size):
                K.set_value(state, np.zeros((batch_size, dim)))
        else:
            K.set_value(self.states[0],
                        np.zeros((batch_size, self.cell.state_size)))
    else:
        if not isinstance(states, (list, tuple)):
            states = [states]
        if len(states) != len(self.states):
            raise ValueError('Layer ' + self.name + ' expects ' +
                             str(len(self.states)) + ' states, '
                             'but it received ' + str(len(states)) +
                             ' state values. Input received: ' +
                             str(states))
        for index, (value, state) in enumerate(zip(states, self.states)):
            if hasattr(self.cell.state_size, '__len__'):
                dim = self.cell.state_size[index]
            else:
                dim = self.cell.state_size
            if value.shape != (batch_size, dim):
                raise ValueError('State ' + str(index) +
                                 ' is incompatible with layer ' +
                                 self.name + ': expected shape=' +
                                 str((batch_size, dim)) +
                                 ', found shape=' + str(value.shape))
            # TODO: consider batch calls to `set_value`.
            K.set_value(state, value)

def get_config(self):
    config = {'return_sequences': self.return_sequences,
              'return_state': self.return_state,
              'go_backwards': self.go_backwards,
              'stateful': self.stateful,
              'unroll': self.unroll}
    if self._num_constants is not None:
        config['num_constants'] = self._num_constants

    cell_config = self.cell.get_config()
    config['cell'] = {'class_name': self.cell.__class__.__name__,
                      'config': cell_config}
    base_config = super(RNN, self).get_config()
    return dict(list(base_config.items()) + list(config.items()))

